  response:
    body: {string: '{"capacity":0.0,"description":"Fullerite is the solid-state manifestation
        of fullerene molecules and can be found naturally occurring within interstellar
        gas clouds. Fullerites are coveted for the unique structural properties that
        make them some of the most useful materials known to humankind. Fullerene-based
        technology has applications in electronics, propulsion and engineering as
        well as the construction of ultra-hard metal alloys and heat-resistant weapons
        systems.\r\n\r\nAlthough all of the empires have developed a rudimentary understanding
        of how to manipulate fullerene, only the Jovians are known to have mastered
        the science. This has allowed them to maintain a significant technological
        advantage over other races in many crucial areas. ","graphic_id":3225,"group_id":711,"icon_id":3225,"market_group_id":1859,"mass":0.0,"name":"Fullerite-C32","packaged_volume":5.0,"portion_size":1,"published":true,"radius":100.0,"type_id":30376,"volume":5.0}'}
